//Home/index.js
import api from '../../utils/api'
import { Link } from 'react-router-dom'
import { useState, useEffect } from 'react'

function Home() {
    const [pet, setPet] = useState({})

    useEffect(() => {
        api.get('/pets').then((response) => {
            setPet(response.data.pets)
        })
    }, [])

    return (
        <div>Home</div>
    )
}
export default Home
